PRESIDENTE BOLSONARO, MELHOR PRESENTE QUE JÁ TIVEMOS HONESTO VERDADEIRO TRANSPARENTE, ELE PODE TER A FALA BRUTA MAS É O JEITO DELE A NATUREZA DELE MAS TUDO Q FEZ NO GOVERNADOR FOI PRA MELHORAR CONDIÇÕES DO BRASIL. O POVO TEM Q ACORDAR E VOTAR NELE, NÃO É CORRUPTO, DÁ SATISFAÇÃO DO Q FAZ COM O DINHEIRO DO POVO.
